	this.frame_0 = function() {
		var sounds = [];
		for (var i = 0; i <= 32; i++) {
			sounds.push({src:"streamsound" + i + ".mp3", id:"streamsound" + i});
		}
		createjs.Sound.on("fileload", loadHandler, this);
			 
		var isLoaded = createjs.Sound.registerSounds(sounds, 'sounds/');
		console.log('is sound loaded: ' + isLoaded);
		if (isLoaded[0] === true) {
			//已经加载完成音频文件，开始直接播放
			createjs.Sound.off("fileload", loadHandler, this);
			this.addEventListener("tick", onTick.bind(this));
		}
			 
		function loadHandler(event)
		{
			this.addEventListener("tick", onTick.bind(this));
		}
		
		this.pauseButton.addEventListener("click", onPauseButtonClick.bind(this));
		
		function onPauseButtonClick()
		{
			this.paused = true;
			currentSound.paused = true;
			this.pauseButton.visible = false;
			this.resumeButton.visible = true;
		}
		
		this.resumeButton.addEventListener("click", onResumeButtonClick.bind(this));
		
		function onResumeButtonClick()
		{
			this.paused = false;
			currentSound.paused = false;
			this.pauseButton.visible = true;
			this.resumeButton.visible = false;
		}
		
		function onTick()
		{
			playBackgroundMusic.call(this);
		}
		
		var currentLabel = '';
		var currentSound = null;
		
		function playBackgroundMusic()
		{
			if (this.getCurrentLabel() != currentLabel) {
				currentLabel = this.getCurrentLabel();
				console.log(currentLabel);
				currentSound = createjs.Sound.play(currentLabel);
			}
		}
		
		this.backToIndexButton.addEventListener("click", onBackToIndexButtonClick.bind(this));
		
		function onBackToIndexButtonClick()
		{
			if (this.backToIndexButton.visible) {
				this.backToIndexButton.visible = false;
				backToChooseEquationScene();
			}
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(2540));

	// 小精灵2
	this.instance = new lib.sprite42();
	this.instance.parent = this;
